import{_ as a}from"./chunks/index.VAya1KE4.js";import{c as p,o as s,G as e,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const r=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":"那维莱特","idList":[504621,504570,504440,501214,503614,501157,501213,6489,3386,1058,1433,1056,1220,1498,503613,503612,4074,4073,500207,1290,502928,502927,5111,1627,502306,500987,501624,2404,501625,501626,2142,4334,6180,59,75,1057,501441,4081,500419,5020,500291,5865,500286,6937,500673,4780,5494,3875,3564,3276,1360,2040,57,2123,2403,2124,55,111,1744,501212,500672,500605,500292,7257,6938,6594,6490,6285,5866,5493,5297,4781,4736,4333,4197,4148,3387,3275,2606,2125,2402,78,382,105,92,241,1221,54,644,56,61,112,76,79,1055,1291,1795,2415],"data":{"id":500207,"name":"那维莱特","summary":"那维莱特","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/09/22/4328207/df52fcefd995f94e041d9baec6ae891d_7203866992337938184.png","avatar":{"m":"https://act-upload.mihoyo.com/wiki-user-upload/2023/09/22/4328207/3d364d06bba0f8591d74f0a3f0ba3e6e_6964610367056109962.png","pc":"https://act-upload.mihoyo.com/wiki-user-upload/2023/09/22/4328207/869a275e9a6dd6abb73c791b5016fe16_3843849378997345755.png"},"attrs":[["地区","枫丹廷"],["星级","五星"],["神之眼所属","枫丹"],["元素","水"],["武器","法器"],["始基力","芒"],["生日","12月18日"],["所属","枫丹廷"],["定位","水元素输出型角色"],["武器类型","法器"],["命之座","原海巨灵座"],["称号","谕告的潮音"]],"destiny":[["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/14a7e234f2bbdada5fd8a40c95646510_1133955344323611858.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/14a7e234f2bbdada5fd8a40c95646510_1133955344323611858.png\\" style=\\"width: 40px; border: \\"></span></span></span>尊荣的创定</p>","<p>那维莱特登场时，获得一层固有天赋「古海孑遗的权柄」的「遗龙之荣」。需要解锁固有天赋「古海孑遗的权柄」。</p><p>此外，进行重击蓄力·诉论心证与重击·衡平推裁时，提高那维莱特的抗打断能力。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/e83cb3d8b8df25fc4799458053bb25bf_2589568434479676702.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/e83cb3d8b8df25fc4799458053bb25bf_2589568434479676702.png\\" style=\\"width: 40px; border: \\"></span></span></span>律法的命诫</p>","<p>固有天赋「古海孑遗的权柄」获得强化：每存在一层「遗龙之荣」，就使重击·衡平推裁的暴击伤害提升14%，至多通过这种方式提升42%。</p><p>需要解锁固有天赋「古海孑遗的权柄」。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/f6f5498580e321d62a269bf97d0ae8ec_6288654288478133103.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/f6f5498580e321d62a269bf97d0ae8ec_6288654288478133103.png\\" style=\\"width: 40px; border: \\"></span></span></span>溯古的拟制</p>","<p>普通攻击·如水从平的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/e1330cdd64b2c97ca0a275a97b290a91_1778606457326748085.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/e1330cdd64b2c97ca0a275a97b290a91_1778606457326748085.png\\" style=\\"width: 40px; border: \\"></span></span></span>悲悯的冠冕</p>","<p>那维莱特处于当前场上并受到治疗时，将产生1枚源水之滴。此效果每4秒至多触发一次。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/4f19b1919bce7dc7dd887b7ef816c7de_1339175558179975022.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/4f19b1919bce7dc7dd887b7ef816c7de_1339175558179975022.png\\" style=\\"width: 40px; border: \\"></span></span></span>公理的决裁</p>","<p>潮水啊，我已归来的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/59fab7a63b976107336719a68e9c99dc_8660501938219086638.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/59fab7a63b976107336719a68e9c99dc_8660501938219086638.png\\" style=\\"width: 40px; border: \\"></span></span></span>忿怒的报偿</p>","<p>施放重击·衡平推裁时，那维莱特可以吸收附近一定范围内的源水之滴，每吸收一枚源水之滴，都将使重击·衡平推裁的持续时间延长1秒。</p><p>此外，重击·衡平推裁命中敌人时，每2秒，将额外释放两道洪流，每道洪流造成相当于那维莱特生命值上限10%的水元素伤害。通过这种方式造成的伤害视为重击·衡平推裁造成的伤害。</p>"]],"skill":[{"title":"普通攻击·如水从平","desc":"普通攻击\\n轻挥权杖，驱动浪涛进行至多三段的攻击，造成水元素伤害。\\n\\n重击蓄力·诉论心证\\n蓄力时，那维莱特汇聚源水之力，逐渐构成仲裁的徽记。在这种状态下，那维莱特能够进行移动与改变朝向，并吸收一定范围内的源水之滴。\\n每吸收一枚源水之滴，都会加快徽记形成的速度，并为那维莱特恢复生命值。\\n停止蓄力时，若徽记尚不完满，将进行重击；若已经完满，则将转为进行重击·衡平推裁。\\n\\n重击\\n消耗一定体力，以迸发的水环猛击敌人，造成水元素范围伤害。\\n\\n重击·衡平推裁\\n释放汹涌的洪流，对前方直线区域内的敌人持续造成水元素范围伤害。\\n重击·衡平推裁不消耗体力，持续3秒。\\n若生命值高于50%，那维莱特在施放时将持续消耗生命值。\\n\\n下落攻击\\n凝聚水元素的力量，从空中下坠冲击地面，攻击下落路径上的敌人，并在落地时造成水元素范围伤害。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/09/24/4328207/3e62b3cd180d05866c41b631d0344bf4_8013500097055316236.png"},{"title":"泪水啊，我必偿还","desc":"降下汹涌的水瀑，基于那维莱特的生命值上限，对前方的敌人造成水元素范围伤害，命中敌人后，将在敌人附近产生3枚源水之滴。\\n\\n始基力：芒性\\n每隔一段时间，在降下汹涌的水瀑后，将降下穿透敌人的灵息之刺，造成具有芒性的水元素伤害。\\n\\n「法律可以遏制诸般罪行，但它并不能消除罪恶本身。」","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/09/24/4328207/9e0ddfff90aac7da3ba778d135520aa1_610857537181298557.png"},{"title":"潮水啊，我已归来","desc":"释放迸发的骇浪，基于那维莱特的生命值上限，造成水元素范围伤害，短暂间隔后，在附近降下2道水瀑，造成范围较小的水元素伤害，并在前方一定范围内产生6枚源水之滴。\\n\\n「法律在颁布后方才成立，而在此之上，自然的法则从亘古以来便约束着全部的种类与世代。」","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/09/24/4328207/37f3e1f19f37090ade0a480be8ec586f_6073830009466450755.png"},{"title":"古海孑遗的权柄","desc":"队伍中的角色对敌人触发蒸发、冻结、感电、绽放、水元素扩散或水元素结晶反应时，将为那维莱特产生持续30秒，至多叠加3层的「遗龙之荣」效果，使重击·衡平推裁造成原本110%/125%/160%的伤害。\\n每种元素反应产生的「遗龙之荣」分别独立存在。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/09/24/4328207/e4f4c3254a280ef456218cf8b01fa926_4408372772472573096.png"},{"title":"至高仲裁的纪律","desc":"基于当前生命值超出生命值上限30%的部分，每1%使那维莱特获得0.6%水元素伤害加成，通过这种方式，至多提升30%。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/09/24/4328207/578df3fec114827ad3ba151b1508b4dd_2766898989404761029.png"},{"title":"汇聚如浪潮一般","desc":"队伍中自己的角色进行水下冲刺时，移动速度提升15%。\\n无法与效果完全相同的固有天赋叠加。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/09/24/4328207/d84bced873c81fac6337099d7df7b2d3_6266945663900502128.png"}]},"favModalLocalKey":"vitepress_game_ys_role_fav_modal","favLocalKey":"vitepress_game_ys_role_fav"},"relativePath":"game/ys/role/那维莱特.md","filePath":"game/ys/role/[pkg].md"}'),i={name:"game/ys/role/那维莱特.md"},g=Object.assign(i,{setup(o){return(d,c)=>(s(),p("div",null,[e(t(a))]))}});export{r as __pageData,g as default};
